import React from 'react';
import PageHeader from '../PageHeader/PageHeader';
import classes from "./Projects.module.css";
import './project.css';

const handleURL=(url) =>{
    return() =>
         window.open(url,"_blank")
}

const Project = () =>{
    return(
        <>
        <h1 className={classes.head}>Projects</h1>
        <div className={classes.Project} id="projects">
         <div className="card" style={{width: "18rem"}}>
  <div className="card-body">
    <h2 className="card-title">Website</h2>
    <p className="card-text">Website using HTML,CSS,Javascript and Bootstrap which provide the C++ programming Tutorials in a easy language.</p>
    <a onClick={handleURL('https://github.com/sagar24263/Project-1st-Year.git')} className="btn btn-primary">Repo Link</a>
  </div>
  </div>
  <div className="card" style={{width: "18rem"}}>
  <div className="card-body">
    <h2 className="card-title">Flower Class Predictor</h2>
    <p className="card-text">This project used ANN model to predict flower class by using Iris Flower Dataset and deployed on heroku by using Flask.</p>
    <a onClick = {handleURL('https://flower-model.herokuapp.com/')} className="btn btn-primary">Project Link</a>
  </div>
  </div>
  <div className="card" style={{width: "18rem"}}>
  <div className="card-body">
    <h2 className="card-title">Notepad GUI</h2>
    <p className="card-text">This is a Notepad GUI created by using Python Tkinter.</p>
    <a onClick={handleURL('https://github.com/ritik1234/notepad.git')} className="btn btn-primary">Repo Link</a>
  </div>
</div>
        </div>
        </>
    );
}

export default Project;
